import React, { Component } from "react";

mapStateToProps;

export class Admin extends Component {
  constructor(props) {
    super(props);
    this.state = {
      userSession: JSON.parse(localStorage.getItem("user"))
    };
  }

  componentDidMount() {
    this.setState({
      // userSession: JSON.parse(localStorage.getItem("user"))
    });
  }

  render() {
    const userData = this.state.userSession.data;

    return (
      <div>
        {userData.map(user => (
          <h1>Admin Page {user.username}</h1>
        ))}
      </div>
    );
  }
}

export default Admin;
